    { className: 'post-login-container' },
    React.createElement(Navbar, null), // Render the Navbar component
    React.createElement(
      'header',
      { className: 'lord-of-the-rings-header' },
      React.createElement('h1', null, 'Welcome to Middle-earth Productivity'),
      React.createElement(
        'p',
        null,
        'One Ring to rule them all, and in your productivity, bind them!'
      )
    ),
    React.createElement(
      'div',
      { className: 'content' },
      React.createElement('h2', null, 'Your Journey Begins Here'),
      React.createElement(
        'p',
        null,
        'This is the post-login page content. Embark on a productive adventure!'
      )
    )
  );
}

module.exports = PostLogin;
